package main

import (
	"encoding/base64"
	"os"
)

func main() {
	pdf := ""

	dec, err := base64.StdEncoding.DecodeString(pdf)
	if err != nil {
		panic(err)
	}

	f, err := os.Create("myfilename.pdf")
	if err != nil {
		panic(err)
	}
	defer f.Close()

	if _, err := f.Write(dec); err != nil {
		panic(err)
	}
	if err := f.Sync(); err != nil {
		panic(err)
	}

}
